INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('6009801956985', 'Rooibos Vintage Thé', 'Rooibos saveur « VINTAGE ROMANCE» (20 pyramides) Le rooibos est un arbuste qui pousse uniquement en Afrique du Sud dans les montagnes du Cederberg. Le rooibos est riche en anti-oxydants teneur en tanin est faible et sa contrairement au thé. L\'infusion de rooibos peut-être bue chaude ou froide, avec ou sans lait. Il se boit comme du thé mais a l\'avantage de ne pas contenir de théine. Différentes vertus médicinales lui sont prêtées et la composition originale « Vintage Romance» (voir ingrédients) lui donne un goût unique et envoutant. infuser la laisser Préparation ; pyramide 3mn dans l\'eau bouillante. Idéalement boire à 600. Ingrédient : Rooibos, honeybush, boutons et pétales de rose, églantier, lavande, fruits des bois, soucis des jardins (calendula), hibiscus et zeste d\'orange. A consomrner de préférenœ avant : voir sous le paquet Importé par S\'prit du Cap Tél : 0692 74 58 03', 'https://static.openfoodfacts.org/images/products/600/980/195/6985/front_fr.4.400.jpg', '0', '0', '0', '0', '', '0', '0', '0', '', '1');

